Blockly.Msg.TOUR1_DESCRIPTION00 = "hurrengoa";
Blockly.Msg.TOUR1_DESCRIPTION01 = "Ongi etorri,<br>sakatu »hurrengoa« eta hasi gida-buelta bat Open Roberta Lab-en zehar.<br>NEPO bitartez zure robota nola programa dezakezun erakutsiko dizugu.<br>Gida hau edozein momentutan bukatu dezakezu eskuin-goikaldeko »X« sakatuz.";
Blockly.Msg.TOUR1_DESCRIPTION02 = "Menua ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "Hemen robota programatzeko beharko duzun guztia aurkitu duzu!<br><span class=\"typcn typcn-document-text\"></span> Programak gorde eta kargatu<br><span class=\"typcn typcn-Roberta\"></span> Konektatu zure robota Open Roberta Lab-era<br><span class=\"typcn typcn-lightbulb\"></span> Laguntza edozein motako arazoetarako<br><span class=\"typcn typcn-user\"></span>Denetarik erabiltzaile kontuetaz, adib. sisteman sartu edo atera";
Blockly.Msg.TOUR1_DESCRIPTION04 = "Hemen sakatu eta bueltatu robot konfiguraziora";
Blockly.Msg.TOUR1_DESCRIPTION05 = "Robotaren konfigurazioa geroago moldatu dezakezu,<br>beste robot bat eraiki baldin baduzu.<br>Ez badaukazu robotik eta zure programa simulazioan frogatu nahi baduzu <br> konfigurazio hau erabiliko da.";
Blockly.Msg.TOUR1_DESCRIPTION06 = "Hemen sakatu eta bueltatu programazio gunera!";
Blockly.Msg.TOUR1_DESCRIPTION07 = "Erreminta kutxa.<br>Hemen programazio bloke guztiak aurkituko dituzu";
Blockly.Msg.TOUR1_DESCRIPTION07a = "Once you are an experienced user you can switch here to the expert mode of the toolbox.<br>You will then find more blocks to program your robot.<br><span class='typcn typcn-media-stop-outline'></span> beginner mode<br><span class='typcn typcn-star-outline'></span> expert mode";  // untranslated
Blockly.Msg.TOUR1_DESCRIPTION08 = "Programa bakoitza programa-hasiera-bloke-arekin hasten da.<br>Gainontzeko blokeak, robotak exekutatuko dituenak, bloke honi itsatsi behar zaizkio.<br>Zuzenean hartu eta arrastatu nahi duzun blokea hasiera-blokearen azpian.";
Blockly.Msg.TOUR1_DESCRIPTION09 = "Hemen lasterbide batzuk aurkituko dituzu!<br>Ezkerretik eskubira:<br><span class=\"typcn typcn-media-play\"></span> Hemen sakatu programa benetazko robotan exekutatzeko<br><span class=\"typcn typcn-media-play-outline\"></span> Hemen sakatu robota simulazioan  hasiarazteko<br><span class=\"typcn typcn-cloud-storage\"></span> Zure programa gorde, baina lehenengo sisteman sartu behar zara<br><span class=\"typcn typcn-zoom\"></span> Hemen sakatu eta zoom egin blokeetan, hala nahi baduzu<br><span class=\"typcn typcn-archive\"></span> Zaborra! blokeak zaborrera arrastatu eta ezabatu ahalko dituzu.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kontuz: ezabatutako blokeak ezingo dituzu berreskuratu!<br>";
Blockly.Msg.TOUR1_DESCRIPTION10 = "»Ekintza« gainean sakatu";
Blockly.Msg.TOUR1_DESCRIPTION12 = "Orain arrastatu eta jaregin bloke berria hasiera-blokearen azpian. Era horretan konektatuta egongo dira";
Blockly.Msg.TOUR1_DESCRIPTION13 = "Orain simulazioa ireki...";
Blockly.Msg.TOUR1_DESCRIPTION13a = "eta zure programa simulazioan probatu!";
Blockly.Msg.TOUR1_DESCRIPTION15 = "Bikain,<br>zure robota 20 cm mugitzen ari da aurrerantz,<br>hau da programatu duzuna!";
Blockly.Msg.TOUR1_DESCRIPTION16 = "Agur eta ondo pasa saiakera gehiago egiten!";
